import React from 'react';
import './index.css';

class Mypage extends React.Component {
    cunstructor(){

        this.name = '鈴木萌斗';
    }
    render(){
        return(
            <div className='Mypage'>
                <img src="../../Images/Moeto.jpg" alt="face photo" height='100%' width='100%'/>
                <h1>{this.props.name}</h1>
            </div>
        )
    }
}
export default Mypage;
